import { Component, OnInit } from '@angular/core';
import { FudbalskitimService } from './services/fudbalskitim.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  constructor(private fudbalskitimService: fudbalTimService) {
    const timID = this.trenutniTimID; // Pretpostavljam da negde definisane trenutniTimID

    this.timService.loadTimById(timID);
    this.timService.loadIgraciZamena(timID);
    this.timService.loadIgraciTeren(timID);
    this.timService.loadGolmani(timID);
    this.timService.loadOdbrambeni(timID);
    this.timService.loadVeznjaci(timID);
    this.timService.loadNapadaci(timID);
  }
  title = 'AngularProjekat';
}
